def get_sublist_cate(link):    
    res = requests.get(link)
    info = res.text
    data = bf(info, 'html.parser')    
    cate_div = data.find_all('div', {'class': 'mid-all-list'})
    sub_links = set()
    for cd in cate_div:
        for h in cd('h3'):
            a = h('a',href=True)
            link_nums = re.search(r'=\d+',a[0]['href']).group()
            sub_links.add(f"http://browse.gmarket.co.kr/list?category{link_nums}")
    return sub_links
        
def collect_sellers(cate_links):
    link = set()    
    cate_a = True
    p = 1
    while cate_a:        
        if p == 21:
            break        
        time.sleep(random.choice(wtime))
        res = requests.get(f"{cate_links}&p={p}&s=8", headers=headers)    
        info = res.text
        data = bf(info, 'html.parser')    
        cate_a = data.find_all('a', {'class': 'link__shop'}, href=True)        
        for a in cate_a:
            link.add(a['href'])
        p += 1
    return link


